import { Morph } from 'lively.morphic';
import { pt } from "lively.graphics/index.js";

export default class SelectableEntry extends Morph {
  static get properties () {
    return {
      entryName: {
        // the actual name this entry represents
      },
      entryList: {
        // a reference to the list that manages this entry
      },
      orderMode: {
        after: ['master'],
        set (active) {
          this.setProperty('orderMode', active);
          this.draggable = active;
          this.nativeCursor = active ? 'grab' : 'auto';
          this.refresh();
        }
      },
      isSelected: {
        after: ['master'],
        set (isSelected) {
          this.setProperty('isSelected', isSelected);
          this.refresh();
        }
      }
    };
  }

  toggleEdit () {
    // do nothing since we are not editable
  }

  static wrap (entryName, opts) {
    const entry = new SelectableEntry({
      entryName,
      master: 'styleguide://$world/galyleo/selectable entry'
    });
    entry.master.reconcileSubmorphs().then(() => {
      Object.assign(entry, opts);
    });
    return { isListItem: true, morph: entry };
  }

  startShifting () {
    this.entryList.startShiftingEntry(this);
    this.master = 'styleguide://Dashboard Studio Development/galyleo/selectable entry/dragged';
  }

  stopShifting () {
    this.master = 'styleguide://Dashboard Studio Development/galyleo/selectable entry';
    this.entryList.stopShifting();
  }

  shiftOrder (verticalOffset, evt) {
    this.entryList.pushShiftedElementBy(verticalOffset, evt);
  }

  onDrag (evt) {
    const { dragStartMorphPosition, absDragDelta } = evt.state;
    this.shiftOrder(absDragDelta.y, evt);
  }

  onDragStart (evt) {
    this.startShifting();
  }

  onDragEnd (evt) {
    this.stopShifting();
  }

  refresh () {
    const checkbox = this.getSubmorphNamed('checkbox');
    const dragControl = this.getSubmorphNamed('drag control');
    const entryName = this.getSubmorphNamed('entry name');
    if (!checkbox || !dragControl || !entryName) return;

    entryName.value = this.entryName;
    dragControl.draggable = this.orderMode;
    checkbox.master = this.isSelected ? 'styleguide://Dashboard Studio Development/galyleo/checkbox/checked' : 'styleguide://Dashboard Studio Development/galyleo/checkbox/unchecked';
    const updateElements = () => {
      if (checkbox.isLayoutable != !this.orderMode) {
        checkbox.isLayoutable = checkbox.visible = !this.orderMode;
      }
      if (dragControl.isLayoutable != !!this.orderMode) {
        dragControl.isLayoutable = dragControl.visible = !!this.orderMode;
      }
    };
    this.world()
      ? this.withAnimationDo(updateElements, {
        duration: 300
      })
      : updateElements();
  }

  onMouseUp (evt) {
    super.onMouseUp(evt);
    // toggle checkbox
    if (this.isComponent) return;
    this.isSelected = !this.isSelected;
  }
}

