import { Morph } from "lively.morphic";
import { arr } from "lively.lang/index.js";
import { connect } from "lively.bindings/index.js";

export default class HorizontalSpacer extends Morph {
  relayout () {
    if (this.owner.layout && this.owner.layout.name() == 'Horizontal') {
      const layout = this.owner.layout;
      const otherWidth = arr.sum(layout.layoutableSubmorphs.filter(m => m != this).map(m => m.bounds().width + layout.spacing)) + 2 * layout.spacing;
      this.width = this.owner.width - otherWidth;
    }
  }

  onOwnerChanged (newOwner) {
    super.onOwnerChanged(newOwner);
    if (!newOwner) {
      if (this._prevOwner) {
        const lastCon = this._prevOwner.attributeConnections.find(c => c.targetObj == this);
        if (lastCon) lastCon.disconnect();
      }
    } else if (newOwner.layout) {
      this._prevOwner = newOwner;
      connect(newOwner, 'extent', this, 'relayout');
    }
  }
}

