import { UserFlap } from "lively.user/morphic/user-ui.js";
import { Color, Rectangle } from "lively.graphics/index.js";

export default class DashboardUserFlap extends UserFlap {
  onLoad () {
    super.onLoad();
    this.whenRendered().then(_ => {
      this.dashboard = this.get('dashboard');
      const labelType = {
        type: 'label',
        name: 'room-name',
        fontSize: 8,
        fontFamliy: 'Helvetica Neue, Verdana, Sans Serif',
        fontWeight: 'bold',
        padding: Rectangle.inset(4),
        reactsToPointer: false
      };
    });
  }

  async updateNetworkIndicator (l2lClient = this.dashboard.l2lclient) {
    const roomName = this.dashboard.l2lRoomName;
    const getColor = async () => {
      if (!l2lClient || !l2lClient.isOnline()) {
        return 'red';
      }
      if (!l2lClient.isRegistered()) {
        return 'orange';
      }
      const roomJoined = roomName && Object.keys(await l2lClient.joinedRooms()).indexOf(roomName) >= 0;
      if (roomJoined) {
        if (this.dashboard.unsentMessages) {
          return 'lightGreen';
        } else {
          return 'green';
        }
      } else {
        return 'yellow';
      }
    };

    if (roomName && this.getSubmorphNamed('room-name')) {
      const displayString = roomName.length > 13 ? `${roomName.substr(0, 10)}...` : roomName;
      this.getSubmorphNamed('room-name').textString = displayString;
    }

    this.get('network-indicator').animate({
      fill: Color[await getColor()], duration: 300
    });
  }
}

