import { Morph } from 'lively.morphic';
import SelectableEntry from 'SelectableEntry/index.js';

export default class RedesignedViewFilterChooser extends Morph {
  /*
  ** A View Filter Chooser.  This consists of two lists, a list of
  ** selected widgets on the right and a list of unselected widgets on the
  ** left.  A Select button moves the left list's selection(s) to the right,
  ** a Deselect button moves the right list's selection(s) to the left.
  */

  get widgetsList () {
    return this.getSubmorphNamed('widgets list');
  }

  // Initalize.  We get a list of all filter names, and
  // those that have been selected.  Sort through the allFilterNames
  // list, and all of those that appear in selectedFilterNames get
  // added to the selected list, and those that don't get added to the
  // unselected list.  Then initialize the unselectedFilterList with
  // unselected and selectedFilterList with selected.
  // parameters:
  //   allFilterNames: the names of all filters that can apply to the underlying table
  //   selectedFilterNames: filters already chosen to apply to this view

  init (allFilterNames, selectedFilterNames = []) {
    this.widgetsList.items = allFilterNames.map(filterName => {
      return SelectableEntry.wrap(filterName, {
        isSelected: selectedFilterNames.includes(filterName),
        entryList: this.widgetsList
      });
    });
  }

  // Get the filters that are currently selected.  This is this editor's
  // contribution to the ViewSpec.

  get selectedFilters () {
    // change that
    return this.widgetsList.items
      .filter(item => item.morph.isSelected)
      .map(item => item.morph.entryName);
  }
}

