import { Morph } from 'lively.morphic';
import { resource } from 'lively.resources/src/helpers.js';
import { arr } from 'lively.lang/index.js';
import TableEntry from 'TableEntry/index.js';
import { once } from 'lively.bindings/index.js';

export default class RedesignedViewFilterPanelFork extends Morph {
  /*
  ** This manages the internal filters of the view spec -- those filters
  ** that don't correspond to charts or widgets, but whose value is set
  ** by the dashboard designer at dashboard design time.  This is used, for
  ** example, to trim trivial values, or to select one specific item from
  ** a table -- for example, the Nationwide vote in Presidential Elections.
  ** This consists of a list of internal filters, with the type and column of
  ** each, buttons that let a designer add a new filter, remove an existing
  ** filter, or edit an existing filter.  If the designer adds a filter, a
  ** panel appears so he can configure it (choose column and type).  If he
  ** chooses edit, a panel appears so he can edit the existing filter (adjust
  ** min/max for a range, or the value for a select).  Remove just removes from
  ** the list.
  */
  // Initialize with the dashboard, tablename, columns that can be used for filters,
  // and any existing filters.  dashboard and tableName are required to determine
  // which columnNames can be used for which filters.  After initializing,
  // update the displayed list of filters.
  // parameters:
  //   dashboard: the dashboard this view belongs to
  //   table: name of the underlying table for this view
  //   columnNames: names of the column of the table
  //   filterList: existing filters
  init (dashboard, table, columnNames, filterList = []) {
    this.dashboard = dashboard;
    this.table = table;
    this.columnNames = columnNames;
    this.filterList = filterList;
    this.__updateFilterList__();
  }

  // Show the list of filters.  This is a list of strings of the form
  // ColumnName/filterType, e.g., Year/Select or Percentage/Range.  This
  // is called whenever the filters change (init, by the createFilter()
  // or by removeSelectedFilter
  __updateFilterList__ () {
    const wrappedItems = this.filterList.map(filter =>
      TableEntry.wrapDataEntry(`${filter.columnName}/${filter.filterType}`, {
        onDelete: () => this.removeFilter(filter),
        onConfig: () => this.editFilter(filter)
      }));
    this.getSubmorphNamed('internalFilterList').items = wrappedItems;
  }

  // The name of the filterBuilder submorph, added in response to a
  // createNewFilter request.  We can only have one panel at a time,
  // so we use a uniform name for this and don't create a new filter
  // if one exists already.

  get __filterBuilderName__ () {
    return 'filterBuilder';
  }

  // The filter builder we already have, if one exists

  get __filterDialog__ () {
    return this.__findNamedSubmorph__(this.__filterBuilderName__);
  }

  // The name of the filterEditor submorph, added in response to an
  // editSelectedFilter request.  We can only have one panel at a time,
  // so we use a uniform name for this and don't create a new filter
  // if one exists already.

  get __filterEditorName__ () {
    return 'filterEditor';
  }

  // The filter editor we already have, if one exists

  get __filterEditor__ () {
    return this.__findNamedSubmorph__(this.__filterEditorName__);
  }

  // A Utility to find any submorph of name name.  We use this to avoid
  // creating two builder or two editor dialogs.

  __findNamedSubmorph__ (name) {
    const morphs = this.submorphs.filter(m => m.name == name);
    return morphs.length == 1 ? morphs[0] : null;
  }

  // Create a new filter.  This is called in response to the Create button.
  // Check to see if a filter builder exists; if not, create one, initialize
  // it with the appropriate columns, and add it to the panel.  When a filter
  // is created it will call back to the createFilter() function, below.

  createNewFilter () {
    const filterBuilder = "part://Dashboard Studio Development/galyleo/internal filter builder";
    resource(filterBuilder).read().then(filterBuilderMorph => {
      filterBuilderMorph.name = this.__filterBuilderName__;
      const rangeColumns = this.dashboard.getColumnsOfType(['number'], this.table);
      const selectColumns = this.dashboard.getColumnsOfType([], this.table);
      filterBuilderMorph.init(this, rangeColumns, selectColumns);
      this._openInFader(filterBuilderMorph);
    });
  }

  // Create a filter of type type, with PartURL partURL, and columnName
  // column name.  Calls the dashboard to create the filter, adds it to the
  // list of filters, then updates the filter list.  This is called from the
  // ViewFilterBuilder.createFilter method.
  // parameters:
  //   filterType: the filterType, currently one of range/select
  //   filterPartURL: URL of the filter's part
  //   columnName: the column the filter is over.

  createFilter (filterType, filterPartURL, columnName) {
    this.dashboard.makeFilterMorph(columnName, filterType, filterPartURL, this.table).then(morph => {
      this.filterList.push(morph);
      if (this.filterDialog) {
        this.filterDialog.remove();
      }
      this.__updateFilterList__();
    });
  }

  // Remove the selected filter from the list of internal filters.
  // Just get the selection and remove it.  This is called in response
  // to the Remove button on the panel.

  // removeSelectedFilter () {
  //   const index = this.getSubmorphNamed('internalFilterList').selectedIndex;
  //   if (isNaN(index)) {
  //     return;
  //   }
  //   this.filterList.splice(index, 1);
  //   this.__updateFilterList__();
  // }

  // Directly removes the provided filter.
  // This is called directly from the filter list items.

  removeFilter (filter) {
    arr.remove(this.filterList, filter);
    this.__updateFilterList__();
  }

  // Edit the selected filter.  Check to see if we already have an
  // editor open; if so, re-initialize it.  If we don't, build one and
  // initialize it with the filter from the filterList.
  // Note that there are no callbacks; the editor operates directly
  // on the filter.

  // editSelectedFilter () {
  //   const index = this.getSubmorphNamed('internalFilterList').selectedIndex;
  //   if (isNaN(index)) {
  //     return;
  //   }
  //   if (this.__filterEditor__) {
  //     this.__filterEditor__.init(this.filterList[index]);
  //   } else {
  //     resource('part://$world/filterEditor').read().then(editor => {
  //       editor.name = this.__filterEditorName__;
  //       this._openInFader(editor);
  //       editor.init(this.filterList[index]);
  //     });
  //   }
  // }

  editFilter (filter) {
    if (this.__filterEditor__) {
      this.__filterEditor__.init(filter);
    } else {
      resource("part://Dashboard Studio Development/galyleo/filter editor").read().then(editor => {
        editor.name = this.__filterEditorName__;
        this._openInFader(editor);
        editor.init(filter);
      });
    }
  }

  _openInFader (morph) {
    const fader = this.get('fader');
    fader.addMorph(morph);
    fader.animate({ opacity: 1, duration: 300 });
    once(morph, 'remove', () => fader.animate({ opacity: 0, duration: 300 }));
  }
}

