import { Morph } from "lively.morphic/morph.js";

export default class RoomPrompt extends Morph {
  // Initialize with the dashboard containing the current room name -- this
  // will be called back to to update the room name in updateRoomName.  This is
  // called by promptNewRoom in dashboard

  init (dashboard) {
    this.dashboard = dashboard;
    this.getSubmorphNamed('roomName').textString = dashboard.l2lRoomName;
  }

  // An internal routine to ensure the room name is valid.  A room name must
  // start with a non-space character, so the parameter roomName must have
  // been .trim()med before being passed in.  Can have spaces internally, and
  // any upper- or lower-case character, digit, and a number of punctuation
  // characters.  No quotes, back-ticks, or double quotes.  Valid characters are
  // in validChars.  Returns true iff the length is >= 0 and every character is
  // in validChars.  Note no leading or trailing whitespace taken care of by
  // trim() before the call
  // parameters
  //   roomName -- string to test for validity

  _valid_ (roomName) {
    const validChars = '0123456789abcdefghijklmnopqrtsuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ!@#$%^&*()[]{},.<>:;\| ';
    return roomName.length > 0 && roomName.split().reduce((acc, cur) => acc && validChars.indexOf(cur) >= 0, true);
  }

  // Check to see if the input is a valid room name.  If it is, update the
  // room name on the dashboard and close; if it isn't, show the input bar to
  // indicate an error.  Note that (see the comments above _valid_) we trim()
  // the input.  Called when the input is accepted (enter) or the Change button
  // is pressed.

  updateRoomName () {
    const newRoomName = this.getSubmorphNamed('roomName').textString.trim();
    if (!this._valid(newRoomName)) {
      this.getSubmorphNamed('roomName').show();
    } else {
      this.dashboard.join(newRoomName);
      this.remove();
    }
  }
}

